dow._bt_scale_range = function (range, min, max, pad) {\n        \"use strict\";\n        if (min !== Infinity &amp;&amp; max !== -Infinity) {\n            pad = pad ? (max - min) * .03 : 0;\n            range.start = min - pad;\n            range.end = max + pad;\n        } else console.error('backtesting: scale range error:', min, max, range);\n    };\n}\n\nclearTimeout(window._bt_autoscale_timeout);\n\nwindow._bt_autoscale_timeout = setTimeout(function () {\n    /**\n     * @variable cb_obj `fig_ohlc.x_range`.\n     * @variable source `ColumnDataSource`\n     * @variable ohlc_range `fig_ohlc.y_range`.\n     * @variable volume_range `fig_volume.y_range`.\n     */\n    \"use strict\";\n\n    let i = Math.max(Math.floor(cb_obj.start), 0),\n        j = Math.min(Math.ceil(cb_obj.end), source.data['ohlc_high'].length);\n\n    let max = Math.max.apply(null, source.data['ohlc_high'].slice(i, j)),\n        min = Math.min.apply(null, source.data['ohlc_low'].slice(i, j));\n    _bt_scale_range(ohlc_range, min, max, true);\n\n    if (volume_range) {\n        max = Math.max.apply(null, source.data['Volume'].slice(i, j));\n        _bt_scale_range(volume_range, 0, max * 1.03, false);\n    }\n\n}, 50);\n"},"id":"2841093","type":"CustomJS"},{"attributes":{"data":{"equity_dd":{"__ndarray__":"AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwPwAAAAAAAPA/AAAAAAAA8D8AAAAAAADwP9YbFBD8b+8/5ceI2QVi7z+KLv7dE5DvPxTzTur0CO8/Fceaq0zj7j9vV3ZTH5fuP9mp0VTcC+8/rtHONQC+7j+GdZVzw33uP+xpepUkK+4/YJZKM26O7j8reznEZEfuPyyY6p2gMe4/MTwexUX27T/rSGc8Z93tPy73Ybcq/e0/nPRRnqbj7T+N0U2ye6HtP7Gq1rFune0/l1WeGMdc7T9mHWHkKyntP1JMR1LsHu0/RO0YVxMN7T92TzmPk9XrP3IvaGexaes/HayDPntn6z8oQmmIHwXsPyyk+Flljes/3mW7o/8s6z9c0A81HhTrP1i6G4rSPOs/b9HRDFM76z+dhRwoJ1vrP0NMVaDuUes/RxIFPvRp6z+eW3KqpszrP/o+CtPG7Os/l8gTthdw6z8b8aV3/z3rPzcqcyF9dOs/rXDgmX1z6z/aiBwkATjrPzLKkHtjJes/rwF2n+/46j+oX29IhtjqPylyeyB2ceo/2kiNJmJM6j8urcpzeULqPyPKiQl5w+k/zoiTep206T9k5Ti9MGXpP0oitQKjuOk/fOw7w3Nm6T8d+EdSaJbpP9ZDUX33kOk
